import React from 'react';
import './Footer.css';
import logoTwitter from '../logoTwitter.png'
import logoFacebook from '../logoFacebook.png'
import logoInstagram from '../logoInsta.png'

const footerScrubs = [
  {
    link: "http://www.facebook.com",
    logo: {logoFacebook}
  },
  {
    link: "https://twitter.com/login?lang=fr",
    logo: {logoTwitter}
  },
  {
    link: "https://instagram.com",
    logo: {logoInstagram}
  },
  {
    home: "Home"
  },
  {
    home: "Selected Profil"
  }, 
  {
    home: "My Account"
  },
  {
    home: "Legal Mentions"
  },
  {
    home: "Contact Us"
  },
] 



const Footer = () =>(
      <footer className="footerDistributed">
        {footerScrubs.map(poulet => (

        <>
          <div className="footerRight">
            <a className="footerIcon" href={poulet.link}><img className="footerImg"src={poulet.logo}/></a>
          </div> 
          <div className="footerLeft">  
             <p className="footerLinks">  
               <a href="home"> {poulet.home} </a>
             </p>  
           </div>
           <p> Scrub &copy; 2019 </p>
         </>
         ) )}    
      </footer>

)   


export default Footer;
